function loadPilots(e){$.ajax({headers:{RequestVerificationToken:$("#RequestCsrfToken").val()},type:"GET",dataType:"json",contentType:"application/json",url:"/E170961/Flights/GetPilotsFor?date="+e,success:function(e){console.log(e),$("#pilots").empty(),e.value.forEach(e=>{$("#pilots").append(`<option value="${e.id}">${e.name}</option>`)})}})}function submit(e){document.getElementById("reservationFilter").value=e,document.getElementById("myForm").submit()}function loadGraph(){$(document).ready(function(){$.ajax({headers:{RequestVerificationToken:$("#RequestCsrfToken").val()},type:"GET",dataType:"json",contentType:"application/json",url:"/E170961/Statistics/GetStats",success:function(o){google.charts.load("current",{packages:["corechart"]}),google.charts.setOnLoadCallback(function(){var e=o,t=new google.visualization.DataTable,a=(t.addColumn("string","helicopter"),t.addColumn("number","value"),[]);$.each(e.value,function(e,t){a.push([t.key,t.value])}),t.addRows(a),new google.visualization.ColumnChart(document.getElementById("barchart_div")).draw(t,{title:"Flights fill percentage",width:600,height:500,legend:"none"})})}})})}$("#selectedDate").change(function(){loadPilots(this.value)}),$("#selectedDate").valueAsDate=(new Date).toLocaleDateString();